package com.higgs.trust.slave.dao.po.manage;import com.higgs.trust.slave.dao.po.BaseEntity;import java.util.Date;public class PolicyPO extends BaseEntity<PolicyPO> {    private static final long serialVersionUID = 1L;    /**     * policy ID     */    private String policyId;    /**     * policy name     */    private String policyName;    /**     * related rs ids     */    private String rsIds;    /**     * create time     */    private Date createTime;    public String getPolicyId() {        return this.policyId;    }    public void setPolicyId(String policyId) {        this.policyId = policyId;    }    public String getPolicyName() {        return this.policyName;    }    public void setPolicyName(String policyName) {        this.policyName = policyName;    }    public String getRsIds() {        return this.rsIds;    }    public void setRsIds(String rsIds) {        this.rsIds = rsIds;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    @Override public String toString() {        StringBuilder builder = new StringBuilder();        builder.append("PolicyPO [");        builder.append("policyId=");        builder.append(policyId);        builder.append(", policyName=");        builder.append(policyName);        builder.append(", rsIds=");        builder.append(rsIds);        builder.append(", createTime=");        builder.append(createTime);        builder.append("]");        return builder.toString();    }}